import React from "react";
import { Grid, Card, Typography, Box, Item } from "@mui/material";
import data from "../data.json";

const CountryData = () => {
  return (
    <Grid
      container
      spacing={{ xs: 2, md: 3 }}
      columns={{ xs: 4, sm: 8, md: 12 }}
    >
      {data?.map((value, index) => (
        <Grid item xs={2} sm={4} md={4} key={index}>
          <Card
            sx={{
              width: "350px",
              height: "420px",
              marginLeft: "30px",
              marginTop: "30px",
            }}
          >
            <img
              src={value.flags.svg}
              alt={value.name}
              width={350}
              height={250}
            />

            <Typography marginLeft={3} fontWeight={500} variant="h6">
              {value.name}
            </Typography>
            <Box display={"flex"} marginLeft={3} marginTop={3}>
              <label>population :</label>
              <Typography>{value.population}</Typography>
            </Box>

            <Box display={"flex"} marginLeft={3}>
              <label>region :</label>
              <Typography>{value.region}</Typography>
            </Box>
            <Box display={"flex"} marginLeft={3}>
              <label>capital :</label>
              <Typography>{value.capital}</Typography>
            </Box>
          </Card>
        </Grid>
      ))}
    </Grid>
  );
};

export default CountryData;
